obj= JSON.parse(localStorage.getItem('myJavaScriptObject'));
if(!obj){

    var obj={
        "language":"fr",
    }
    localStorage.setItem('myJavaScriptObject', JSON.stringify(obj));
    $(".ar").hide();
   
}
else{
    

  
  var lang=obj['language'];
 
  if(lang=="fr")
    {
    
    $(".ar").hide();
 
    $("#lang").text("عربية");
    }
    else if(lang=="ar")
    {
    $(".fr").hide();
    $("#lang").text("Fr");


    }
}
