function change_param()
{


    $(".param1").toggle(1000);

    $(".param2").toggle();

}



function change_param_ar(key)
{

    if(key=="gps"){
        $(".param1").fadeIn(1000);

        $(".param2").hide();
        $(".param3").hide();
      
     
        $("#myDropdown").toggleClass('show');
            
    }
    else if(key=="perso"){
        $(".param1").hide();

        $(".param2").fadeIn(1000);
        $(".param3").hide();
    
        $("#myDropdown").toggleClass('show');

    }
    else {

        $(".param1").hide();

        $(".param2").hide();
        $(".param3").fadeIn(1000);
        $("#myDropdown").toggleClass('show');

    }


}
